// SPDX-License-Identifier: MIT
pragma solidity 0.8.18;
import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

// library dont support state variables only functions that are related
library PriceConverter {
    function getprice ()internal  view  returns(uint256){
//adress 0x694AA1769357215DE4FAC081bf1f309aDC325306
AggregatorV3Interface priceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
    (
           ,
            int256 price,
           ,
           ,
           
        ) = priceFeed.latestRoundData();

        return uint256(price * 1e10);
}


function conversionRate(uint256 ethamount) internal  view returns(uint256){
uint256 ethprice =getprice();

uint256 ethusd = (ethprice* ethamount)/1e18;
return ethusd;


}
}

